import React, { useState } from 'react'
import styles from './index.module.css';
import MainTitle from '../../components/MainTitle';
import MyButtonValue from '../../components/MyButtonValue';


export default function Shooting() {

  const [idScreen, setIdScreen] = useState(0);

  function set(){
    setIdScreen(1);
  }

  return (
    <div className='full_size main_block'>

        <MainTitle title="Тир" />

        <div className={styles.screen_game}>
          <img className='full_size' src={process.env.PUBLIC_URL + '/images/BGShooting.jpg'}>

            {idScreen == 0 && <div className={styles.start_window}>
              <MyButtonValue>
                1
              </MyButtonValue>
            </div>}

          </img>
        </div>

    </div>
  );
}
